import React, { useState, useEffect } from 'react';
import EleveService from '../../services/ServicesEleve';
import './Eleve.css';


export default function () {
    const [eleve, setEleve] = useState([]);
    useEffect(() => {
        let id = localStorage.getItem('idEleve');
        var bodyFormData = new FormData();
        bodyFormData.append('id_eleve', id);
        EleveService.getFiliereEleve(bodyFormData)
            .then(res => {
                const elev = res.data.result;
                console.log(elev.length);
                setEleve(elev);

                console.log(res.data.result);
                // console.log(eleve);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            });
    }, []);
    return (
        <>
            <div className="wrapper">
                {/* <h1> {eleve?.elev?.gestion}</h1> */}
            </div>
        </>);
}
